Insert into SHOP (SHOP_ID,TRADER_TYPE_ID,SHOP_NAME,SHOP_DESCRIPTION) values (22,3,'The Cornish Fishmonger','The Cornish Fishmonger is a family run specialist fishmonger, involved in the fishing industry since its creation by Robert Clifford-Wing some thirty years ago. During this time the business has earned an enviable reputation throughout the country for supplying top quality fish and seafood to many of the nations top chefs. The same quality fish and seafood ordered by Michelin starred chefs can be yours.');
Insert into SHOP (SHOP_ID,TRADER_TYPE_ID,SHOP_NAME,SHOP_DESCRIPTION) values (23,4,'Bakers Oven','Bakers Oven was founded by Allied Bakeries in 1976, and its first location was in Barnard Castle. In 1984, the company acquired the sixty four outlets of Carricks of Newcastle, and converted them to Bakers Oven. In March 1990, there were 628 outlets and four main bakeries.');
Insert into SHOP (SHOP_ID,TRADER_TYPE_ID,SHOP_NAME,SHOP_DESCRIPTION) values (24,61,'West Street Deli','With Bird & Carter and East Harnham Deli to choose from there''s little chance of going hungry in the Salisbury area. The pick of this fine bunch, though, is the new kid on the block, West Street Deli, which opened last autumn and is packed with local produce. The range currently includes organic veg and salad from Sting''s Lake House company, but the shop also buys in anything from courgettes to truffles from local gardeners with a glut and sells it on either as is or turned into delicious, home-made ready-meals.');
Insert into SHOP (SHOP_ID,TRADER_TYPE_ID,SHOP_NAME,SHOP_DESCRIPTION) values (1,1,'Fresh Mart','Freshest of the fresh goods available here.');
